      var runChart
      var runXMin = document.getElementById("runXMin"),

      var applyRunDomains = function() {
        runChart.xDomain([runXMin.value, runXMax.value])

      var resetRunDomains = function() {
        runChart.xDomain(null)

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#run')
          runChart = nv.models.lineChart()
          runChart

              var xDomain = runChart.xAxis.domain(),
                  yDomain = runChart.yAxis.domain()
              runXMin.value = xDomain[0]

          runChart.xAxis
            .axisLabel("Run")
            .showMaxMin(false)

            .showMaxMin(false)

            window.onresize = function() {
                var svg = d3.select('#run')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })
    </script>

      var queueChart
      var queueYMin = document.getElementById("queueYMin"),

      var applyLatencyDomains = function() {
        queueChart.yDomain([queueYMin.value, queueYMax.value])
        queueChart.update()
      }

      var resetLatencyDomains = function() {
        queueChart.yDomain(null)
        queueChart.update()
      }

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#queue')
          queueChart = nv.models.lineWithFocusChart()
          queueChart
            .width(svg.attr('width'))
            .dispatch.on('renderEnd', function(){
              var yDomain = queueChart.yAxis.domain()
              queueYMin.value = yDomain[0]
              queueYMax.value = yDomain[1]
            })

          queueChart.xAxis
            .axisLabel("time, ms")
            .showMaxMin(false)

          queueChart.yAxis
            .axisLabel("count")
            .showMaxMin(false)

          svg.datum(queueData).call(queueChart)

          return queueChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#queue')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })
